import React from 'react';
import ClimbPhoto from '../../images/climb.jpeg';

import './AboutMe.css';

const AboutMe = ({id}) => {
    return(
            <div className = 'vh-100 center mt5' id = {id}>
                <div className = 'border-height'>
                    <h1 className = 'tc pt5 fw5'>About Me</h1>
                    <div className = 'bb w-50 center'>
                    </div>
                </div>

                <div className = 'flex items-start justify-start'>
                    <img src = {ClimbPhoto}
                         className = 'br-100 h5 w5 shadow-5 ba'
                         alt = 'sad' />
                </div>

            </div>
 );
}

export default AboutMe;
